    // remember to register any new methods into extralibs/mathcode.d.ts.txt

    constructor(canvasID: string = 'canvas') {
        this.canvasID = canvasID

        this.loader()   // start reading in the images

        let canvas = document.getElementById('canvas') as HTMLCanvasElement
        var scale = 2;
        canvas.width = 640 * scale;
        canvas.height = 480 * scale;

        this.context = canvas.getContext("2d")!;

    }

    ctx(){   // this needs to be async, and to WAIT for this.waitImages()
        return this.context
    }

    placeTile(tile:HTMLImageElement, x:number,y:number,height:number){
        // tiles are 170 wide (actually 171) and 100 high (actually 101)
        let drawX = x*101
        let drawY = y*80 - (height*40)
        this.context.drawImage(tile,drawX,drawY)
    }


    // a promise to wait for the onload
    loadImage(img: HTMLImageElement) {
        return new Promise((resolve, reject) => {
            img.onload = () => resolve(this.context)
            img.onerror = reject
        })
    }


